(1, 'Beijing', 'History and culture are always indispensable elements in Beijing tours. For first-time visitors, tracing the glorious past at iconic sites like the Forbidden City and the Great Wall of China is a must. For a more intimate and authentic experience of Beiji', , 100000, 8, 82, 0, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(4, 'Golden Triangle', 'Beyond the must-visit golden triangle cities: Beijing, Xi\'an, and Shanghai, this 11-day tour also extends to Zhangjiajie. Besides historical sites like Great Wall, the Forbidden City, Terracotta Warriors, Hanyang Tomb, and the colonial Bund, you will enjoy Zhangjiajie\'s stunning scenery. Explore the Avatar Mountains in the National Forest Park, and have a thrilling walk on the glass walkways in Tianmen Shan National Forest Park.', , 100000, 8, 72, 0, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(5, 'Panda Volunteer', 'Discover the enchantment of China\'s treasures, including adorable pandas, in a captivating family journey! Dive into Beijing\'s history at Tiananmen Square and the Forbidden City. Conquer the Great Wall\'s majestic ramparts and unravel the mysteries of Xi\'an\'s Terracotta Army. Delight in a panda volunteer program in Chengdu and indulge in Shanghai\'s bustling cityscape. The icing on the cake is the Chinese calligraphy experience, tea-tasting among the locals, and dim-sum sampling dotted around.', , 100000, 14, 55, 0, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(6, 'Yangtze', 'Starting in Beijing and ending in Shanghai, this 13-day tour will show you the best of China. You will hike the Great Wall and experience the traditional Hutong lifestyle in the capital city, marvel at the Terracotta Warriors and walk around the Muslim Street in Xi\'an, and admire the natural beauty of Li River and Reed Flute Cave in Guilin. What else? View the impressive Three Gorges Dam by the Yangtze River Cruise, and explore the city highlights of Shanghai.', , 100000, 8, 72, 0, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(7, 'Tibet', 'Take this leisurely tour delving into China\'s rich history, captivating culture, and breathtaking scenery. You can ascend the magnificent Great Wall comfortably via cable car. With a battery automobile, explore the army of Terracotta Warriors. Relax on a Li River cruise while admiring some of the world\'s most beautiful karst landforms. Ride a boat on Hangzhou West Lake\'s smooth water and experience the unique waterside scenery of Wuzhen. Stroll through the old streets of Shanghai to uncover its cosmopolitan allure.', , 100000, 8, 79, 0, 'Alam, Budaya, Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(8, 'Hongkong', 'Beyond the must-visit golden triangle cities: Beijing, Xi\'an, and Shanghai, this 11-day tour also extends to Zhangjiajie. Besides historical sites like Great Wall, the Forbidden City, Terracotta Warriors, Hanyang Tomb, and the colonial Bund, you will enjoy Zhangjiajie\'s stunning scenery. Explore the Avatar Mountains in the National Forest Park, and have a thrilling walk on the glass walkways in Tianmen Shan National Forest Park.', , 150000, 14, 76, 0, 'Modern');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(9, 'Silk Road', 'A Silk Road tour in China\'s wild west is always exciting and can even change your life. Follow the ancient trade route that connected the East and West to learn about its colorful history, interesting culture, and beautiful landscapes. See amazing sights like theTerracotta WarriorsinXian. tOurSilk Road toursoffer an unforgettable adventure and are designed for comfort, making sure everyone will enjoy their Silk Road travel experience.', , 75000, 8, 94, 0, 'Modern, Budaya, Festival');
INSERT INTO `tours` (`id`, `nama_tempat`, `deskripsi_tempat`, `gambar_tempat`, `harga`, `jumlah_hari`, `jumlah_like`, `jumlah_rating`, `tema`) VALUES
(10, 'Foodies', 'Beyond the must-visit golden triangle cities: Beijing, Xi\'an, and Shanghai, this 11-day tour also extends to Zhangjiajie. Besides historical sites like Great Wall, the Forbidden City, Terracotta Warriors, Hanyang Tomb, and the colonial Bund, you will enjoy Zhangjiajie\'s stunning scenery. Explore the Avatar Mountains in the National Forest Park, and have a thrilling walk on the glass walkways in Tianmen Shan National Forest Park.', , 50000, 8, 64, 0, 'Modern, Budaya, Festival');

